/*******************************************************************************
   Drop database if it exists
********************************************************************************/
IF EXISTS (SELECT name FROM master.dbo.sysdatabases WHERE name = N'PE_DBI202_Sp2022_B5')
BEGIN
	ALTER DATABASE PE_DBI202_Sp2022_B5 SET OFFLINE WITH ROLLBACK IMMEDIATE;
	ALTER DATABASE PE_DBI202_Sp2022_B5 SET ONLINE;
	DROP DATABASE PE_DBI202_Sp2022_B5;
END

GO

CREATE DATABASE PE_DBI202_Sp2022_B5
GO

USE PE_DBI202_Sp2022_B5
GO

/*******************************************************************************
	Drop tables if exists
*******************************************************************************/
DECLARE @sql nvarchar(MAX) 
SET @sql = N'' 

SELECT @sql = @sql + N'ALTER TABLE ' + QUOTENAME(KCU1.TABLE_SCHEMA) 
    + N'.' + QUOTENAME(KCU1.TABLE_NAME) 
    + N' DROP CONSTRAINT ' -- + QUOTENAME(rc.CONSTRAINT_SCHEMA)  + N'.'  -- not in MS-SQL
    + QUOTENAME(rc.CONSTRAINT_NAME) + N'; ' + CHAR(13) + CHAR(10) 
FROM INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS AS RC 

INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE AS KCU1 
    ON KCU1.CONSTRAINT_CATALOG = RC.CONSTRAINT_CATALOG  
    AND KCU1.CONSTRAINT_SCHEMA = RC.CONSTRAINT_SCHEMA 
    AND KCU1.CONSTRAINT_NAME = RC.CONSTRAINT_NAME 

EXECUTE(@sql) 

GO
DECLARE @sql2 NVARCHAR(max)=''

SELECT @sql2 += ' Drop table ' + QUOTENAME(TABLE_SCHEMA) + '.'+ QUOTENAME(TABLE_NAME) + '; '
FROM   INFORMATION_SCHEMA.TABLES
WHERE  TABLE_TYPE = 'BASE TABLE'

Exec Sp_executesql @sql2 
GO
/****** Object:  Table [dbo].[authors] */
CREATE TABLE [dbo].[authors](
	[authorId] [int] NOT NULL,
	[name] [varchar](50) NULL,
	[surname] [varchar](70) NULL,
 CONSTRAINT [PK_authors] PRIMARY KEY (authorId)
)
GO
/****** Object:  Table [dbo].[types]  */
CREATE TABLE [dbo].[types](
	[typeId] [int] NOT NULL,
	[name] [varchar](30) NULL,
PRIMARY KEY ([typeId])
)
GO
/****** Object:  Table [dbo].[books]  */
CREATE TABLE [dbo].[books](
	[bookId] [int] NOT NULL,
	[name] [varchar](90) NULL,
	[pagecount] [int] NULL,
	[point] [int] NULL,
	[authorId] [int] references authors(authorId) NULL,
	[typeId] [int] references [types](typeId) NULL,
 CONSTRAINT [PK_books] PRIMARY KEY ([bookId])
)
GO
/****** Object:  Table [dbo].[students]  */
CREATE TABLE [dbo].[students](
	[studentId] [int] NOT NULL,
	[name] [varchar](20) NULL,
	[surname] [varchar](20) NULL,
	[birthdate] [date] NULL,
	[gender] [varchar](10) NULL,
	[class] [varchar](7) NULL,
	[point] [int] NULL,
PRIMARY KEY ([studentId])
)
GO
/****** Object:  Table [dbo].[borrows]  */
CREATE TABLE [dbo].[borrows](
	[borrowId] [int] NOT NULL,
	[studentId] [int] references Students(studentId),
	[bookId] [int] references Books(bookId),
	[takenDate] [datetime] NULL,
	[broughtDate] [datetime] NULL,
 CONSTRAINT [PK_borrows] PRIMARY KEY ([borrowId])
)
GO

